def extract_mxfile_from_url(url: str) -> str:
    parsed = urlparse(url)

    if not parsed.fragment:
        raise ValueError("Нет fragment в ссылке.")

    fragment = parsed.fragment

    # 🔹 Формат #R
    if fragment.startswith("R"):
        data = unquote(fragment[1:])

        # ✅ ЕСЛИ ЭТО УЖЕ XML — ВОЗВРАЩАЕМ
        if data.strip().startswith("<mxfile"):
            print("Обнаружен встроенный XML (без base64).")
            return data

        # Иначе это base64+deflate
        missing_padding = len(data) % 4
        if missing_padding:
            data += "=" * (4 - missing_padding)

        decoded = base64.b64decode(data)

        try:
            decompressed = zlib.decompress(decoded, -15)
        except zlib.error:
            decompressed = zlib.decompress(decoded)

        return decompressed.decode("utf-8")

    # 🔹 Формат #U
    elif fragment.startswith("U"):
        external_url = unquote(fragment[1:])
        print("Найдена внешняя ссылка:", external_url)

        request = urllib.request.Request(
            external_url,
            headers={"User-Agent": "Mozilla/5.0"}
        )

        with urllib.request.urlopen(request) as response:
            return response.read().decode("utf-8")

    else:
        raise ValueError("Неизвестный формат fragment.")


def decompress_diagram(mxfile_xml: str) -> str:
    pattern = r"<diagram([^>]*)>(.*?)</diagram>"
    match = re.search(pattern, mxfile_xml, re.DOTALL)

    if not match:
        return mxfile_xml

    attrs = match.group(1)
    content = match.group(2).strip()

    # Если уже нормальный XML
    if content.startswith("<"):
        return mxfile_xml

    try:
        # base64 → deflate
        decoded = base64.b64decode(content)
        decompressed = zlib.decompress(decoded, -15).decode("utf-8")

        # 🔥 ВОТ ЭТО ВАЖНО
        decompressed = unquote(decompressed)

    except Exception as e:
        print("Ошибка распаковки diagram:", e)
        return mxfile_xml

    new_diagram = f"<diagram{attrs}>{decompressed}</diagram>"

    return re.sub(pattern, new_diagram, mxfile_xml, flags=re.DOTALL)




from urllib.parse import urlencode

def export_svg(mxfile_xml: str) -> bytes:
    # вытаскиваем pageId
    page_match = re.search(r'<diagram[^>]*id="([^"]+)"', mxfile_xml)
    page_id = page_match.group(1) if page_match else None

    params = {
        "format": "svg",
        "xml": mxfile_xml,
        "base64": "0",
        "embedImages": "1"
    }

    if page_id:
        params["pageId"] = page_id

    data = urlencode(params).encode("utf-8")

    request = urllib.request.Request(
        EXPORT_URL,
        data=data,
        headers={
            "Content-Type": "application/x-www-form-urlencoded",
            "User-Agent": "Mozilla/5.0"
        }
    )

    with urllib.request.urlopen(request) as response:
        return response.read()




def main():
    if not URL.strip():
        raise ValueError("Ты не вставил ссылку в переменную URL.")

    print("Извлечение mxfile из ссылки...")
    mxfile = extract_mxfile_from_url(URL)

    print("Распаковка diagram (если требуется)...")
    mxfile = decompress_diagram(mxfile)

    print("Отправка в export API...")
    svg_data = export_svg(mxfile)

    Path(OUTPUT_FILE).write_bytes(svg_data)

    print(f"✓ Полный SVG сохранён: {OUTPUT_FILE}")
    print("Размер XML:", len(mxfile))
    print("Первые 200 символов:", mxfile[:200])


if __name__ == "__main__":
    main()